const FiltersGroup = (props) => {
  const { ratingsList, categoryOptions } = props;
  return (
    <div>
      <p>Categories</p>
      <ul>
        {categoryOptions.map((eachCate) => (
          <li key={eachCate.categoryId}>
            <button type="button">{eachCate.name}</button>
          </li>
        ))}
      </ul>
      <p>Ratings</p>
      <ul>
        {ratingsList.map((eachRat) => (
          <li key={eachRat.ratingId}>
            <button type="button">
              <img src={eachRat.imageUrl} alt={eachRat.ratingId} />
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default FiltersGroup;
